var descartesJS = (function(descartesJS) {
  if (descartesJS.loadLib) { return descartesJS; }

  descartesJS.addFonts = function() {
    const fonts = {
      sansserif : {},
      serif: {},
      monospace: {},
      math: {}
    };

    /**
     * Sansserif bold
     */
    fonts.sansserif["normal_bold"] = "";

    /**
     * Sansserif italic bold
     */
    fonts.sansserif["italic_bold"] = "";

    /**
     * Sansserif italic
     */
    fonts.sansserif["italic_normal"] = "";

    /**
     * Sansserif regular
     */
    fonts.sansserif["normal_normal"] = "";


    /**
     * Monospace bold
     */
    fonts.monospace["normal_bold"] = "";

    /**
     * Monospace italic bold
     */
    fonts.monospace["italic_bold"] = "";

    /**
     * Monospace italic
     */
    fonts.monospace["italic_normal"] = "";

    /**
     * Monospace regular
     */
    fonts.monospace["normal_normal"] = "";
    

    /**
     * Serif bold
     */
    fonts.serif["normal_bold"] = "";

    /**
     * Serif italic bold
     */
    fonts.serif["italic_bold"] = "";

    /**
     * Serif italic
     */
    fonts.serif["italic_normal"] = "";

    /**
     * Serif regular
     */
    fonts.serif["normal_normal"] = "";


    /**
     * Math bold and italic bold
     */
    fonts.math["normal_bold"] = fonts.math["italic_bold"] = "";

    /**
     * Math italic and regular
     */
    fonts.math["italic_normal"] = fonts.math["normal_normal"] = "";

    const font_family = ["sansserif", "monospace", "serif", "math"]
    const styles = [["normal", "bold"], ["italic", "bold"], ["italic", "normal"], ["normal", "normal"]];
    let fonts_str = "";

    for (let font_name of font_family) {
      for (let sty of styles) {
        fonts_str += `@font-face{font-family:'DJS_${font_name}';src:url('data:font/woff2;charset=utf-8;base64,${fonts[font_name][sty[0]+"_"+sty[1]]}') format('woff2');font-style:${sty[0]};font-weight:${sty[1]};} `;
      }    
    }

    return fonts_str;
  }

  return descartesJS;
})(descartesJS || {});
